import React, { Component } from 'react';


export default class userlogout extends Component {
        Logout = () => {
            localStorage.clear();
            window.location.href = "/SignIn";
        }

    render() {
        return(
            <Button onClick={this.Logout} variant="dark">Logout</Button>
        )


    }
}
